import React from 'react';
import logo from './logo.svg';
import './app.css';

class App extends React.Component {
  togglePressed = () => {
    var x = document.getElementById("switch");
    x.style.height = "100%"
  }

  render(){
    return (
      <div className="app">
        <div className = "app-container">
          <div className = "container">
            <div className = "titleContainer">
              <div className = "titleMain">
                <div className = "title">
                  <p className = "titleText">{'Toggle'}</p>
                </div>
                <div onClick={this.togglePressed} className="toggleButton">
                  <p className="buttonText">{'Click Me !'}</p>
                </div>
              </div>
            </div>
            <div id="switch" className="secondContainer">

            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
